
<!DOCTYPE html>
<html lang="ko">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>달무띠 왕중왕전</title>
    <style>
        body {
            font-family: 'Arial', sans-serif;
            margin: 0;
            padding: 0;
            background: linear-gradient(to bottom, #232526, #414345); /* 달무띠 느낌 배경색 */
            color: white;
            text-align: center;
        }
        .container {
            margin-top: 20px;
            padding: 20px;
        }
        .title {
            font-size: 2.5rem;
            font-weight: bold;
            margin-bottom: 20px;
        }
        .input-container {
            margin-top: 20px;
        }
        .input-field {
            padding: 10px;
            font-size: 1rem;
            border-radius: 5px;
            border: none;
            outline: none;
            width: 250px;
        }
        .button {
            padding: 10px 20px;
            font-size: 1rem;
            margin-top: 10px;
            background-color: #6A0572; /* 보드게임 테마색 */
            border: none;
            border-radius: 5px;
            color: white;
            cursor: pointer;
        }
        .button:hover {
            background-color: #8A2BE2;
        }
        .invite {
            display: none;
            margin-top: 30px;
            animation: fadeIn 1s ease-in;
        }
        .details {
            margin-top: 20px;
            font-size: 1rem;
        }
        @keyframes fadeIn {
            from { opacity: 0; }
            to { opacity: 1; }
        }
        img {
            width: 80%;
            max-width: 600px;
            margin-top: 20px;
            border-radius: 10px;
        }
    </style>
</head>

        <div class="title">달무띠 연말 왕중왕전</div>
        <p>아래에 이름을 입력하세요:</p>
        <div class="input-container">
            <input type="text" id="nameInput" class="input-field" placeholder="이름을 입력하세요">
            <br>
            <button class="button" onclick="checkName()">확인</button>
        </div>
        <div id="invite" class="invite">
            <h2>환영합니다!</h2>
            <p id="invitedName"></p>
            <p>당신을 달무띠 왕중왕전에 초대합니다!</p>
            
<div class="details">
    <p><strong>일시:</strong> 12월 주말(토 OR 일)</p>
    <p><strong>시간:</strong> 오전 12시</p>
    <p><strong>장소:</strong> EBS 10층 유튜브 사무실</p>
    <p><strong>준비물:</strong> 현금 5만원(식비 게임비)와 약간의 운!</p>
    <p><strong>상품:</strong></p>
    <ul>
        <li>1등: 백화점 상품권 (10만원)</li>
        <li>2등: 이디야 상품권 (3만원)</li>
    </ul>
</div>

        </div>
    </div>

    <script>
        const inviteList = ["임종화", "김하라", "이원석", "김동훈", "유성근", "김영석", "안재민", "안성현"]; // 초대된 이름 리스트
        function checkName() {
            const inputName = document.getElementById("nameInput").value.trim();
            const invite = document.getElementById("invite");
            const invitedName = document.getElementById("invitedName");
            if (inviteList.includes(inputName)) {
                invitedName.textContent = inputName + "님,";
                invite.style.display = "block";
            } else {
                alert("초대 리스트에 없는 이름입니다. 다시 입력해주세요.");
                invite.style.display = "none";
            }
        }
    </script>
